import { Route, Redirect } from "react-router-dom";
import { AuthContext } from "./Auth";

const PrivateRoute = ({ component: RouteComponent, ...rest }) => {
  const {currentUser} = useContext(AuthContext);
  if(currentUser){
      return( <Route
        {...rest}
        render={routeProps =>
            <RouteComponent {...routeProps} />
        }
      />)
